import React, {Component} from 'react';
import './App.css';
import Register from "./components/Register";
import welcome from "./components/welcome";

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
       isRegistered:false,
    }
  }

  render() {
    return (
      <div>
        this.state.isRegistered ? <welcome></welcome> : <Register></Register>
      </div>
    )
  }
}

export default App
